import React, {Component} from 'react';
import './App.css';
import Auth from './Auth/Auth'
import axios from 'axios'
class App extends Component{
    authHandler(){
        const options = {
            method: 'POST',
            //headers: { 'Content-Type': 'x-www-form-urlencoded' },
            body:{'username': "first", 'password': "w8$jdP#u7LMFRJn"},
            url: 'http://127.0.0.1:8000/test1/'
        };
        axios(options)
            .then(res => {
               // console.log(res);
                console.log(res.data);
            })

    }
    render() {
        return (
            <div className="App">
                <Auth authHandler={this.authHandler}/>
            </div>
        );
    }
}

export default App;
